  Title,
  Tooltip,
  Legend,
} from 'chart.js';
import './App.css';
import { BarGraph } from './component/Bar';
import { Bar } from 'react-chartjs-2';

ChartJS.register(
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip
);

interface graphInterface {
  id: number,
  velocity: number
}

interface graphVisuals {
